import { Typography, Box } from '@mui/material';
import React from 'react';
import { RegistrationItem, RegistrationItemProps } from './RegistrationItem';

const registrationDataMock: RegistrationItemProps[] = [
    { date:'10/5', cardId: '1234'},
    { date:'10/5', cardId: '2323'},
    { date:'10/5', cardId: '1000'},

]
export const RegistrationPage = () => {

    return (
    <Box>
         <Typography> Registration </Typography>
        { registrationDataMock.map ( item => <RegistrationItem key={item.cardId} date={item.date} cardId={item.cardId} />)}

    </Box>);
}
